        _UniffiConverterString.write(value.alg, buf)
        _UniffiConverterSequenceUInt8.write(value.sign_cert, buf)
        _UniffiConverterSequenceUInt8.write(value.private_key, buf)
        _UniffiConverterOptionalString.write(value.ta_url, buf)


