class _UniffiConverterTypeError(_UniffiConverterRustBuffer):
    @staticmethod
    def read(buf):
        variant = buf.read_i32()
        if variant == 1:
            return Error.Assertion(
                _UniffiConverterString.read(buf),
            )
        if variant == 2:
            return Error.AssertionNotFound(
                _UniffiConverterString.read(buf),
            )
        if variant == 3:
            return Error.Decoding(
                _UniffiConverterString.read(buf),
            )
        if variant == 4:
            return Error.Encoding(
                _UniffiConverterString.read(buf),
            )
        if variant == 5:
            return Error.FileNotFound(
                _UniffiConverterString.read(buf),
            )
        if variant == 6:
            return Error.Io(
                _UniffiConverterString.read(buf),
            )
        if variant == 7:
            return Error.Json(
                _UniffiConverterString.read(buf),
            )
        if variant == 8:
            return Error.Manifest(
                _UniffiConverterString.read(buf),
            )
        if variant == 9:
            return Error.ManifestNotFound(
                _UniffiConverterString.read(buf),
            )
        if variant == 10:
            return Error.NotSupported(
                _UniffiConverterString.read(buf),
            )
        if variant == 11:
            return Error.Other(
                _UniffiConverterString.read(buf),
            )
        if variant == 12:
            return Error.NullParameter(
                _UniffiConverterString.read(buf),
            )
        if variant == 13:
            return Error.RemoteManifest(
                _UniffiConverterString.read(buf),
            )
        if variant == 14:
            return Error.ResourceNotFound(
                _UniffiConverterString.read(buf),
            )
        if variant == 15:
            return Error.Signature(
                _UniffiConverterString.read(buf),
            )
        if variant == 16:
            return Error.Verify(
                _UniffiConverterString.read(buf),
            )
        raise InternalError("Raw enum value doesn't match any cases")

    @staticmethod
    def write(value, buf):
        if isinstance(value, Error.Assertion):
            buf.write_i32(1)
        if isinstance(value, Error.AssertionNotFound):
            buf.write_i32(2)
        if isinstance(value, Error.Decoding):
            buf.write_i32(3)
        if isinstance(value, Error.Encoding):
            buf.write_i32(4)
        if isinstance(value, Error.FileNotFound):
            buf.write_i32(5)
        if isinstance(value, Error.Io):
            buf.write_i32(6)
        if isinstance(value, Error.Json):
            buf.write_i32(7)
        if isinstance(value, Error.Manifest):
            buf.write_i32(8)
        if isinstance(value, Error.ManifestNotFound):
            buf.write_i32(9)
        if isinstance(value, Error.NotSupported):
            buf.write_i32(10)
        if isinstance(value, Error.Other):
            buf.write_i32(11)
        if isinstance(value, Error.NullParameter):
            buf.write_i32(12)
        if isinstance(value, Error.RemoteManifest):
            buf.write_i32(13)
        if isinstance(value, Error.ResourceNotFound):
            buf.write_i32(14)
        if isinstance(value, Error.Signature):
            buf.write_i32(15)
        if isinstance(value, Error.Verify):
            buf.write_i32(16)



class _UniffiConverterOptionalString(_UniffiConverterRustBuffer):
    @classmethod
    def write(cls, value, buf):
        if value is None:
            buf.write_u8(0)
            return

        buf.write_u8(1)
        _UniffiConverterString.write(value, buf)

    @classmethod
    def read(cls, buf):
        flag = buf.read_u8()
        if flag == 0:
            return None
        elif flag == 1:
            return _UniffiConverterString.read(buf)
        else:
            raise InternalError("Unexpected flag byte for optional type")



class _UniffiConverterSequenceUInt8(_UniffiConverterRustBuffer):
    @classmethod
    def write(cls, value, buf):
        items = len(value)
        buf.write_i32(items)
        for item in value:
            _UniffiConverterUInt8.write(item, buf)

    @classmethod
    def read(cls, buf):
        count = buf.read_i32()
        if count < 0:
            raise InternalError("Unexpected negative sequence length")

        return [
            _UniffiConverterUInt8.read(buf) for i in range(count)
        ]

